import React from "react";
import { Link } from "react-router-dom";
import "./Home.css";
import User1 from "../img/User1.png";
import User2 from "../img/User2.png";
import User3 from "../img/User3.png";

function HomeTestimonials() {
    return (
        <section className="container-testimonials">
            <div className="home-container-testimonials">
                <div home-cards-container>
                    <h3 className="home-testimonials-uppertitle">Our service</h3>
                    <h1 className="home-testimonials-title">Why choose us?</h1>
                    <p className="home-testimonials-subtitle">Make cooking simple, fast, and personalized. Discover quick recipes, plan meals easily, and enjoy healthy options tailored to you.</p>
                </div>
                <div className="home-containers">
                    <div className="home-subcontainers">
                        <img src={User1} className="icons-testimonials" alt="Time" />
                        <h2 className="home-testimonials-title2">Fast and Easy Recipes</h2>
                        <p className="home-testimonials-subtitle2">Discover quick, delicious meals ready in minutes. Perfect for busy days!</p>
                    </div>
                    <div className="home-subcontainers">
                        <img src={User2} className="icons-testimonials" alt="Planner" />
                        <h2 className="home-testimonials-title2">Meal Planning</h2>
                        <p className="home-testimonials-subtitle2">Plan your meals, filter by diet, and generate shopping lists effortlessly.</p>
                    </div>
                    <div className="home-subcontainers">
                        <img src={User3} className="icons-testimonials" alt="Recipe" />
                        <h2 className="home-testimonials-title2">Healthy & Flexible Options</h2>
                        <p className="home-testimonials-subtitle2">Explore vegetarian, gluten-free, and low-calorie recipes tailored to your needs.</p>
                    </div>
                </div>
            </div>
        </section>
    );
}

export default HomeTestimonials;
